import Web3 from "web3";

function Winner(props) {
    return (
        <>
            <td className={"recent-winner"}>{props.winner.player}</td>
            <td className={"recent-winner"}>{Web3.utils.fromWei(props.winner.entranceFeeInWei + '', "ether")}eth</td>
            {/* <td className={"recent-winner"}></td> */}
            <td className={"recent-winner"}>{props.winner.amountWon}eth</td>
            <td className={"recent-winner"}>{props.winner.closedDate}</td>
        </>
    );
}

export default Winner;
